import React from 'react';
import { Link } from 'react-router-dom';

const StreamList = ({ streams }) => {
    return (
      <div>
        <h2>Streams</h2>
        <div className="ui celled list">{this.renderList()}</div>
        {this.renderCreate()}
      </div>
    );
  }


export default StreamList;
